import React from "react";
import {Link} from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Img1 from '../img/carousel_1_2.jpg';
import Img1_slim from '../img/carousel_1_slim.jpg';
import Img2 from '../img/carousel_2_2.jpg';
import Img2_slim from '../img/carousel_2_slim.jpg';
import Img3 from '../img/carousel_3_2.jpg';
import Img3_slim from '../img/carousel_3_slim.jpg';


const useStyles = makeStyles({
  root: {
    maxWidth: 345,
    marginLeft: "auto",
    marginRight: "auto",
    marginTop: "2em"
  },
  media: {
    height: 300,
  },
});

function CardComponent2() {

  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={Img2}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            Geburtsvorbereitung
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Ich helfe Ihnen sich auf die Geburt vorzubereiten. Ich zeige Ihnen auch all die coolen Werkzeuge.
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          <Link to="/services">Mehr Informationen</Link>
        </Button>
      </CardActions>
    </Card>
  );
}

export default CardComponent2;
